con:configuration.scriptText:
import com.eviware.soapui.support.XmlHolder

def holder = new XmlHolder( messageExchange.responseContentAsXml )
holder.namespaces["ns1"] = "http://tempuri.org/"
holder.namespaces["a"] = "http://schemas.datacontract.org/2004/07/MemberRegistrationNew"
def node = holder.getDomNode( "//ns1:UploadMemberRegistrationResponse[1]/ns1:UploadMemberRegistrationResult[1]/a:ErrorReport[1]" )

assert node != null

con:configuration.path:
declare namespace ns1='http://tempuri.org/';
declare namespace a='http://schemas.datacontract.org/2004/07/MemberRegistrationNew';
declare namespace i='http://www.w3.org/2001/XMLSchema-instance';
exists( //ns1:UploadMemberRegistrationResponse/ns1:UploadMemberRegistrationResult/a:MemberId/@i:nil)

con:config.script:

 //def str = context.expand( '${Properties_step#bas64String}' )
def MemID = str = testRunner.testCase.testSteps['Properties'].getPropertyValue("MemberID")

if(MemID.contains('nil')) // == "")
{
	log.info "Member Not Created"


 def str = testRunner.testCase.testSteps['Properties'].getPropertyValue("bas64String")

//log.info "get"

log.info str

byte[] decoded = str.decodeBase64()
def str2 =  new String(decoded)
log.info str2

testRunner.testCase.testSteps['Properties'].setPropertyValue("DecodedValue",str2)

}
else
{
	log.info "Member Created with ID: " + MemID
}

